description:
After years of standing in Jak's shadow, Daxter finally gets his turn inthe spotlight as he stars in his very own self-titled game.

Daxter, on his own in an unfamiliar place, realizes that being small and furry won't help his chances of survival or saving Jak, so he takes on a job as a pest exterminator -- a job in high demand due to a mysterious metalbug invasion. His new job enables him to explore parts of Haven City in an effort to collect the clues that will lead him to Jak ... but Daxter soon discovers more excitement than he bargained for.

I have set up the emulator for the Xbox360 controller, you can re-map for almost any controller.


System Requirements:

Core 2 duo 2.4GHz or higher.

nVidia GeForce GT 620 / ATI Radeon HD 5 series or higher.

3 Gig of ram or more.

Windows XP / Vista / 7 / 8 32 or 64bit OS.


